import { CloverWalletAdapter } from '@solana/wallet-adapter-clover';
import { WalletName } from './types';
export const getCloverWallet = (config = {}) => ({
    name: WalletName.Clover,
    url: 'https://clover.finance',
    icon: 'data:image/svg+xml;base64,',
    adapter: () => new CloverWalletAdapter(config),
});
//# sourceMappingURL=clover.js.map
